import React, { Component } from 'react';
import PDF from 'react-pdf-js';

class ReactPDF extends Component {
    constructor(props) {
        super(props);
        this.state = {
            pdfBase64: ''
        }
    }

    render() {
        var pdf = `data:application/pdf;base64,${this.state.pdfBase64}`;
        return (
            <div>
                <PDF
                    file={pdf}
                    // OR we can use this way 
                    file={JSON.parse(JSON.stringify(pdf))}
                    // onDocumentComplete={this.onDocumentComplete}
                    // page={this.state.page}
                />
            </div>
        );
    }
}

export default ReactPDF;